import Vue from 'vue'
import Router from 'vue-router'
import Home from './views/Home.vue'

Vue.use(Router)

export default new Router({
    mode: 'history',
    base: process.env.BASE_URL,
    routes: [
        {
            path: '/',
            name: 'home',
            component: Home
        },
        {
            path: '/about',
            name: 'about',
            component: () => import('./views/About.vue')
        },
        {
            path: '/language',
            name: 'language',
            component: () => import('./views/Language.vue')
        },
        {
            path: '/gallery',
            name: 'gallery',
            component: () => import('./views/Gallery.vue')
        },
        {
            path: '/extra',
            name: 'extra',
            component: () => import('./views/Extra.vue')
        },
        {
            path: '/dragonquest4',
            name: 'dragonquest4',
            component: () => import('./components/extra/DragonQuest4.vue')
        }
    ]
})
